<!DOCTYPE html>
<html lang="ru">
<head>
  <meta charset="UTF-8">
  <title>–†—É–ª–µ—Ç–∫–∞ –ª—é–±–≤–∏ üíñ</title>
  <meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no">

  <style>
    * {
      box-sizing: border-box;
    }

    html, body {
      margin: 0;
      padding: 0;
      width: 100%;
      height: 100%;
      overflow: hidden;
      position: fixed;
    }

    body {
      font-family: 'Segoe UI', system-ui, sans-serif;
      background: #c8e6f5;
      display: flex;
      align-items: center;
      justify-content: center;
      position: relative;
    }

    body::before {
      content: '';
      position: fixed;
      top: 0;
      left: 0;
      right: 0;
      bottom: 0;
      background: #c8e6f5;
      z-index: -1;
    }

    .container {
      position: relative;
      width: 100%;
      max-width: 420px;
      max-height: 100vh;
      overflow-y: auto;
      overflow-x: hidden;
      box-sizing: border-box;
      -webkit-overflow-scrolling: touch;
      display: flex;
      align-items: center;
      justify-content: center;
      z-index: 10;
    }

    /* Hide scrollbar but keep functionality */
    .container::-webkit-scrollbar {
      width: 0px;
      background: transparent;
    }

    .decorative {
      position: fixed;
      z-index: 0;
      pointer-events: none;
    }

    .decorative img {
      width: 100%;
      height: 100%;
      object-fit: contain;
      filter: none;
    }

    /* –û–±–ª–∞–∫–∞ */
    .clouds-layer {
      width: 200vw;
      height: 200vh;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      opacity: 0.7;
      animation: floatClouds 20s ease-in-out infinite;
    }

    @keyframes floatClouds {
      0%, 100% { transform: translate(-50%, -50%) translateY(0px); opacity: 0.7; }
      50% { transform: translate(-50%, -50%) translateY(-15px); opacity: 0.8; }
    }

    @keyframes float {
      0%, 100% { transform: translate(-50%, -50%) translateY(0px); }
      50% { transform: translate(-50%, -50%) translateY(-20px); }
    }

    @keyframes glow {
      0%, 100% { opacity: 0.9; }
      50% { opacity: 1; filter: drop-shadow(0 0 15px rgba(135, 206, 235, 0.6)); }
    }

    @keyframes wiggle {
      0%, 100% { transform: rotate(-5deg); }
      50% { transform: rotate(5deg); }
    }

    .card {
      background: #ffffff;
      border-radius: 28px;
      padding: 28px 20px 32px;
      width: 100%;
      max-width: 380px;
      text-align: center;
      box-shadow: 0 30px 60px rgba(0,0,0,0.2);
      border: 4px solid #f4a460;
      position: relative;
      z-index: 100;
      margin: 20px;
    }

    h1 {
      margin: 0 0 8px;
      color: #2b5b84;
      font-size: clamp(22px, 5vw, 28px);
      text-transform: uppercase;
      letter-spacing: 1px;
    }

    .subtitle {
      font-size: clamp(13px, 3vw, 15px);
      color: #4682b4;
      margin-bottom: 24px;
    }

    .wheel-container {
      position: relative;
      width: min(260px, 85vw);
      height: min(260px, 85vw);
      margin: 0 auto 24px;
    }

    .arrow {
      position: absolute;
      top: -15px;
      left: 50%;
      transform: translateX(-50%);
      font-size: 32px;
      z-index: 10;
      filter: drop-shadow(0 2px 4px rgba(0,0,0,0.2));
    }

    .wheel {
      width: 100%;
      height: 100%;
      border-radius: 50%;
      border: 12px solid #cd5c5c;
      box-shadow: inset 0 0 0 4px #daa520, 0 8px 20px rgba(0,0,0,0.2);
      background: conic-gradient(
        #f4a460 0deg 45deg,
        #ffdead 45deg 90deg,
        #f4a460 90deg 135deg,
        #ffdead 135deg 180deg,
        #f4a460 180deg 225deg,
        #ffdead 225deg 270deg,
        #f4a460 270deg 315deg,
        #ffdead 315deg 360deg
      );
      position: relative;
      overflow: hidden;
      transition: transform 8s cubic-bezier(.17,.67,.1,1);
    }

    .wheel.spinning {
      transition: transform 8s cubic-bezier(.17,.67,.1,1);
    }

    .sector-text {
      position: absolute;
      width: 50%;
      height: 50px;
      top: 50%;
      left: 50%;
      transform-origin: 0% 50%;
      display: flex;
      align-items: center;
      justify-content: center;
      font-weight: bold;
      color: #8b4513;
      font-size: clamp(10px, 2.8vw, 14px);
      text-transform: uppercase;
      white-space: nowrap;
      padding-left: 15%;
    }

    /* –¶–µ–Ω—Ç—Ä–∏—Ä—É–µ–º –∫–∞–∂–¥—ã–π —Ç–µ–∫—Å—Ç –ø–æ —Å–µ—Ä–µ–¥–∏–Ω–µ –µ–≥–æ —Å–µ–∫—Ç–æ—Ä–∞ */
    .s0 { transform: translateY(-50%) rotate(22.5deg); }
    .s1 { transform: translateY(-50%) rotate(67.5deg); }
    .s2 { transform: translateY(-50%) rotate(112.5deg); }
    .s3 { transform: translateY(-50%) rotate(157.5deg); }
    .s4 { transform: translateY(-50%) rotate(202.5deg); }
    .s5 { transform: translateY(-50%) rotate(247.5deg); }
    .s6 { transform: translateY(-50%) rotate(292.5deg); }
    .s7 { transform: translateY(-50%) rotate(337.5deg); }

    button {
      margin-top: 8px;
      background: linear-gradient(135deg, #cd5c5c, #daa520);
      border: 2px solid #ffffff;
      border-radius: 999px;
      padding: 14px 40px;
      font-size: clamp(16px, 4vw, 18px);
      font-weight: bold;
      color: white;
      cursor: pointer;
      box-shadow: 0 6px 15px rgba(0,0,0,0.2);
      transition: transform 0.2s;
    }

    button:hover:not(:disabled) {
      transform: scale(1.05);
    }

    button:active {
      transform: scale(0.95);
    }

    button:disabled {
      opacity: 0.6;
      cursor: not-allowed;
    }

    .result {
      margin-top: 24px;
      font-size: clamp(18px, 4vw, 20px);
      font-weight: bold;
      color: #cd5c5c;
      min-height: 30px;
      padding: 10px;
      border-radius: 12px;
    }

    .description {
      margin-top: 12px;
      font-size: clamp(14px, 3.5vw, 16px);
      color: #2b5b84;
      background: #e0f4ff;
      padding: 12px 16px;
      border-radius: 12px;
      border: 2px solid #87ceeb;
      line-height: 1.5;
      display: none;
    }

    .description.show {
      display: block;
      animation: fadeIn 0.5s ease-in;
    }

    @keyframes fadeIn {
      from { opacity: 0; transform: translateY(-10px); }
      to { opacity: 1; transform: translateY(0); }
    }

    /* –ú–æ–±–∏–ª—å–Ω–∞—è –∞–¥–∞–ø—Ç–∞—Ü–∏—è –¥–ª—è –¥–µ–∫–æ—Ä–∞—Ç–∏–≤–Ω—ã—Ö —ç–ª–µ–º–µ–Ω—Ç–æ–≤ */
    @media (max-width: 1024px) {
      .card {
        max-width: 360px;
        margin: 15px;
      }
    }

    @media (max-width: 768px) {
      .card {
        max-width: 340px;
        margin: 15px;
      }

      .wheel-container {
        width: min(250px, 85vw);
        height: min(250px, 85vw);
      }
    }

    @media (max-width: 500px) {
      .card {
        padding: 20px 14px 24px;
        max-width: 300px;
        margin: 12px;
      }

      .wheel-container {
        width: min(220px, 75vw);
        height: min(220px, 75vw);
      }

      h1 {
        font-size: 20px;
      }

      .subtitle {
        font-size: 13px;
      }
    }

    @media (max-width: 380px) {
      .card {
        padding: 16px 10px 20px;
        max-width: 280px;
        margin: 10px;
      }

      .wheel-container {
        width: min(200px, 70vw);
        height: min(200px, 70vw);
      }

      h1 {
        font-size: 18px;
      }

      .subtitle {
        font-size: 12px;
      }

      button {
        padding: 12px 32px;
        font-size: 15px;
      }
    }
  </style>
</head>

<body>

        "–ò–≥—Ä–∞–µ–º –≤ —Ç–≤–æ—é –ª—é–±–∏–º—É—é –∏–≥—Ä—É, –∏ –ø–æ–±–µ–¥–∏—Ç–µ–ª—é ‚Äî –ø—Ä–∏–∑ –ø–æ –≤—ã–±–æ—Ä—É",
        "–ü—Ä–∏–¥—É–º—ã–≤–∞–µ–º —Å–≤–æ—é –∏–≥—Ä—É —Å –≤–µ—Å—ë–ª—ã–º–∏ –ø—Ä–∞–≤–∏–ª–∞–º–∏"
      ]
    },
    {
      name: "–ü–ª–µ–π–ª–∏—Å—Ç –¥—Ä—É–≥ –¥–ª—è –¥—Ä—É–≥–∞ üéß",
      descriptions: [
        "–°–æ—Å—Ç–∞–≤–ª—è–µ–º –ø–ª–µ–π–ª–∏—Å—Ç—ã –¥—Ä—É–≥ –¥–ª—è –¥—Ä—É–≥–∞: –≤—ã–±–∏—Ä–∞–µ–º –ø–µ—Å–Ω–∏, –∫–æ—Ç–æ—Ä—ã–µ –Ω–∞–ø–æ–º–∏–Ω–∞—é—Ç –æ –Ω–∞—Å, –∏ —Å–ª—É—à–∞–µ–º –≤–º–µ—Å—Ç–µ",
        "–£—Å—Ç—Ä–∞–∏–≤–∞—é —Ç–µ–±–µ —Å–≤–∏–¥–∞–Ω–∏–µ, –∫–æ—Ç–æ—Ä–æ–µ —Å–ø–ª–∞–Ω–∏—Ä—É—é —Å–∞–º–æ—Å—Ç–æ—è—Ç–µ–ª—å–Ω–æ",
        "–í–µ—Å—å –¥–µ–Ω—å –≥–æ–≤–æ—Ä—é —Ç–µ–±–µ —Ç–æ–ª—å–∫–æ '–¥–∞' –Ω–∞ –ª—é–±—ã–µ –ø—Ä–æ—Å—å–±—ã"
      ]
    }
  ];

  const wheel = document.getElementById('wheel');
  const btn = document.getElementById('spinBtn');
  const result = document.getElementById('result');
  const description = document.getElementById('description');

  let currentRotation = 0;

  btn.onclick = () => {
    btn.disabled = true;
    result.textContent = "–ö–æ–ª–µ—Å–æ —Å—É–¥—å–±—ã –≤—Ä–∞—â–∞–µ—Ç—Å—è...";
    description.classList.remove('show');
    description.textContent = "";

    // –°–ª—É—á–∞–π–Ω–æ–µ –≤—Ä–µ–º—è –≤—Ä–∞—â–µ–Ω–∏—è –æ—Ç 5 –¥–æ 10 —Å–µ–∫—É–Ω–¥
    const spinDuration = 5000 + Math.random() * 5000;
    wheel.style.transition = `transform ${spinDuration}ms cubic-bezier(.17,.67,.1,1)`;

    // –í—Ä–∞—â–µ–Ω–∏–µ –Ω–∞ 5-8 –ø–æ–ª–Ω—ã—Ö –æ–±–æ—Ä–æ—Ç–æ–≤ + —á–µ—Ç–∫–∞—è –æ—Å—Ç–∞–Ω–æ–≤–∫–∞ –≤ —Ü–µ–Ω—Ç—Ä–µ —Å–µ–∫—Ç–æ—Ä–∞
    const targetSector = Math.floor(Math.random() * 8);
    
    // Calculate angle to center of that sector
    // Each sector is 45 degrees, and we want to point at the center (22.5 degrees offset)
    const sectorCenterAngle = (targetSector * 45) + 22.5;
    
    // Add multiple full rotations (5-8 spins) plus the target angle
    const fullRotations = 5 + Math.floor(Math.random() * 4);
    const targetRotation = (360 * fullRotations) + sectorCenterAngle;
    
    currentRotation = targetRotation;
    wheel.style.transform = `rotate(${currentRotation}deg)`;

    setTimeout(() => {
      // We already know which sector we landed on
      const prize = prizes[targetSector];
      
      // Randomly select one of three descriptions
      const randomDescIndex = Math.floor(Math.random() * 3);
      const selectedDescription = prize.descriptions[randomDescIndex];
      
      result.textContent = prize.name;
      description.textContent = selectedDescription;
      description.classList.add('show');
      btn.disabled = false;
    }, spinDuration);
  };
</script>
